  false,\n\t\"url\": null,\n\t\"notes\": \"The gravity station data (32 records) were
  gathered by Mr. Seth I. Gutman for AridTech Inc., Denver, Colorado using a Worden
  Prospector gravity meter. This data base was received in June 1985. Principal gravity
  parameters include Free-air Anomalies and Simple Bouguer Anomalies (no terrain correction
  applied). The observed gravity values are referenced to the International Gravity
  Standardization Net 1971 (IGSN 71). The gravity anomaly computation uses the Geodetic
  Reference System 1967 (GRS 67) theoretical gravity formula. The data are randomly
  distributed within the area of central San Bernardino County, California.\",\n\t\"license_title\":
